export const createCallbackLogger = (cb) => ({
    logInit: (message) => {
        cb({ type: 'params', parameters: message });
    },
    logIncoming: (message) => {
        cb({ type: 'incoming', message });
    },
    logOutcoming: (message) => {
        cb({ type: 'outcoming', message });
    },
});
